import './adminpage.scss';
import { Layout, Menu, Icon } from 'antd';
import {
  AppstoreOutlined,
  BarChartOutlined,
  CloudOutlined,
  ShopOutlined,
  TeamOutlined,
  UserOutlined,
  UploadOutlined,
  VideoCameraOutlined,
  MenuFoldOutlined,
  MenuUnfoldOutlined
} from '@ant-design/icons';


import { 
  DashboardIcon, 
  ClockIcon, 
  MessageIcon, 
  ProfileIcon, 
  ProjectIcon, 
  SearchIcon, 
  SettingIcon, 
  TodolistIcon,
  ArrowIcon,
  ArrowUnfoldIcon
} from '../media/icons/index';
import { ReactComponent as Logo } from '../media/logo.svg';

import { Route, Switch } from 'react-router-dom';


export class About extends Component {
    render() {
        return (
            <div>
                <h1>Header ABout</h1>
            </div>
        )
    }
}

export default About
